import logo from './logo.svg';
import './App.css';
import productData from "./productData";
import {Header} from "./header";
import {Product} from "./product";


function App() {
    const productModal = productData.map(
        item => {
            return (
                <Product
                    list = {item}
                />

            )
        }
    )
    return (
            <div className="body">
                <Header />
                {productModal}
            </div>
        )
}



export default App;
